import{setActiveLink,handleSidebar}from"./utils.min.js";document.addEventListener("DOMContentLoaded",(()=>{setActiveLink(),handleSidebar();document.querySelector("#connect-google-services-form").addEventListener("submit",(async e=>{e.preventDefault();const t=e.target.googlesheet.checked,o=e.target.googledrive.checked;try{const e=await fetch(`/google/services?google_sheet=${t}&google_drive=${o}`),n=await e.json();200===e.status?window.location.replace(n.url):console.log(n)}catch(e){console.log(e)}}))}));